import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-6d9a789e6f6e5",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/study/my-blog/docs/README.md").then(comp => {
        Vue.component("v-6d9a789e6f6e5", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-b373610c600a4",
    path: "/blog/2.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/study/my-blog/docs/blog/2.md").then(comp => {
        Vue.component("v-b373610c600a4", comp.default)
        next()
      })
    }
  },
  {
    name: "v-5e2ccdef16cf4",
    path: "/blog/3.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/study/my-blog/docs/blog/3.md").then(comp => {
        Vue.component("v-5e2ccdef16cf4", comp.default)
        next()
      })
    }
  },
  {
    name: "v-47e97f42f21b8",
    path: "/blog/4.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/study/my-blog/docs/blog/4.md").then(comp => {
        Vue.component("v-47e97f42f21b8", comp.default)
        next()
      })
    }
  },
  {
    name: "v-c0d21b321db04",
    path: "/blog/coffee.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/study/my-blog/docs/blog/coffee.md").then(comp => {
        Vue.component("v-c0d21b321db04", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
